  font-style: normal;
  background: linear-gradient(${(props) => props.boxColor}, white);
  padding: 0;

`;

function App() {
  const Dustset = 48;
  let selectDust = "";

  if (Dustset >= 0 && Dustset <= 30) {
    selectDust = "good";
